    public void onClick(View view) {

        String dname = director.getSelectedItem().toString();
        String ac1 = actor1.getSelectedItem().toString();
        String ac2 = actor2.getSelectedItem().toString();
        String ac3 = actor3.getSelectedItem().toString();
        Log.e("welcome1",ac1 );
        Log.e("welcome2",ac2 );
        Log.e("welcome3",ac3 );
        Log.e("welcome4",dname );

        runthis0 run = new runthis0();
        try {
            run.runthiss0(c);
        } catch (IOException e) {
            e.printStackTrace();
        }

        x[0][0] = 1.0;

        x[0][1] = run.getactorlikes(ac1);
        x[0][2] = run.getactorlikes(ac2);
        x[0][3] = run.getactorlikes(ac3);
        x[0][4] = run.getdirectorlikes(dname);

        x[0][5] =  Double.parseDouble(year.getSelectedItem().toString()) ;
        x[0][6] = Double.parseDouble(duration.getText().toString());
        x[0][7] = Double.parseDouble(faces.getSelectedItem().toString()) ;
        x[0][8] = Double.parseDouble(budget.getText().toString());

        double imdb = p.predict(x);
        rating.setText(String.format("%.2f", imdb));


        if( imdb < 5.0 )
        {
            rating.setBackgroundColor(Color.RED);
        }
        else if (imdb >= 5 && imdb < 8 )
        {
            rating.setBackgroundColor(Color.YELLOW);
        }
        else{
            rating.setBackgroundColor(Color.GREEN);
        }
    }

